import React, { Component } from 'react'

import Items from '../api/controller/buscarterminos.php'
import {
    BrowserRouter as Router,
    Route,
    Switch
    
  } from 'react-router-dom'
class Nav extends Component{
    render(){
        return(
            <Router>
                <div>
                    <ul>
                        <li>
                            
                        </li>
                    </ul>
                </div>
                <Switch>
                    <Route path="/buscarterminos" component={Items}/>
                </Switch>
            </Router>
        );
    }

}
export default Nav;
